import { Typography } from "@mui/material";
import { Box } from "@mui/system";
import React from "react";
import { useLocation } from "react-router-dom";


function Detail(){

    const location = useLocation();

    const clothes = {
        name : location.state?.name,
        price : location.state?.price,
        image : location.state?.image,
        content : location.state?.content,
        from : location.state?.from
    }

    return(
        <Box>
            <Box sx={{
                display: "grid",
                gap: "3rem",
                width:"90%",
                margin: "auto",
                gridTemplateAreas: `"infoPart imagePart orderPart"`,
                gridTemplateColumns: "320px 1fr 320px"                 
            }}>
                    <Box sx={{ gridArea : 'infoPart' , border:1 }}>
                        <Box>
                            <Typography>{clothes.name}</Typography>
                            <Typography>{clothes.price}</Typography>
                        </Box>

                        <Box>
                            <Typography variant="body2"></Typography>

                        </Box>
                        <Box>

                        </Box>
                    </Box>
                    <Box sx={{ gridArea: 'imagePart' , border:1, height:"500px"}}><Box component="img" src={clothes.image} width="100%" height="100%"></Box></Box>
                    <Box sx={{ gridArea: 'orderPart', border:1 }}> Order</Box>
            </Box>

        </Box>
    );
}

export default Detail;
